import { listDecks } from '../../utils/api';
import { useState, useEffect } from 'react';

export default function DeckList() {
    const [deckList, setDeckList] = useState([]);

    useEffect(() => {
        listDecks()
        .then(data => setDeckList(data))
        .catch(err => console.log(err))
    })
}
